description:
Explosions in the Sky, one of the best post-rock bands in the world, have some amazing music. They did the entire sound track to Friday Night Lights, and they deserve to be discovered by you!

This is their discography up to May 22, 2007. Includes all albums; \&amp;#039;How Strange, Innocence\&amp;#039;, \&amp;#039;Those Who Tell the Truth Shall Die, Those Who Tell the Truth Shall Live Forever\&amp;#039;, \&amp;#039;The Earth Is Not a Cold Dead Place\&amp;#039;, \&amp;#039;The Rescue\&amp;#039; aka \&amp;#039;Travels in Constants vol. 21\&amp;#039;, and their latest \&amp;#039;All of a Sudden I Miss Everyone\&amp;#039;

Please download and enjoy! This is the least-offensive music ever, and I haven\&amp;#039;t met a single soul who hasn\&amp;#039;t enjoyed it.
